import Footer from "../../components/footer/Footer";
import Banniere from "../../components/banniere/Banniere";
import { Link } from "react-router-dom";


function Home(){

    return (
        <div className="home">
          <Header />
          <main>
            <Banner texte="Chez vous, partout et ailleurs" image={imgHomeBanner} />
            <Gallery />
          </main>
          <Footer />
        </div>
      );
    };
    
    export default Home;
